import React from 'react';
import { HomeIcon, LogoutIcon } from '@heroicons/react/solid'; // Ensure you have installed heroicons package
import home from '../../src/assests/home.svg';

const NavigationBar = () => {
  return (
    <nav className="bg-blue-900 text-white w-16 md:w-24 flex flex-col items-center py-5 space-y-6">
      <div className="bg-white rounded-full p-2">
        {/* This would be where you place your company logo as an image or SVG */}
      </div>
      <div className="text-white flex flex-col items-center space-y-4">
        <button className="bg-blue-700 text-white rounded p-2 shadow-lg flex items-center justify-center w-full">
        <img src={home} style="margin-bottom: 0.3rem" />
        Add Customer
  
          <span className="hidden md:block">Home</span>
        </button>
        <button className="text-gray-300 rounded p-2 flex items-center justify-center w-full">
          <LogoutIcon className="h-6 w-6" />
          <span className="hidden md:block">History</span>
        </button>
      </div>
      <button className="mt-auto text-gray-300 hover:text-white flex items-center justify-center w-full">
        <LogoutIcon className="h-6 w-6" />
        <span className="hidden md:block">Log Out</span>
      </button>
    </nav>
  );
};

export default NavigationBar;
